import { createClient } from '@supabase/supabase-js';


export default createClient(
  console.log(SUPABASE_URL),
  process.env.SUPABASE_URL,
  process.env.SUPABASE_KEY
);

export function checkError({ data, error }) {
  if (error) {
    throw error;
  }
  return data;
}
